
function Invoke-BloodHound {
 
    param(
        [String[]]
        $CollectionMethod = [string[]] @('Default'),

        [Switch]
        $SearchForest,

        [String]
        $Domain,

        [Switch]
        $Stealth,

        [Switch]
        $SkipGCDeconfliction,

        [Switch]
        $ExcludeDC,

        [String]
        $ComputerFile,

        [String]
        $OU,

        [string]
        $DomainController,

        [int]
        $LdapPort,

        [Switch]
        $SecureLdap,

        [Switch]
        $IgnoreLdapCert,

        [String]
        $LDAPUser,

        [String]
        $LDAPPass,

        [Switch]
        $DisableKerbSigning,

        [ValidateRange(1,50)]
        [Int]
        $Threads = 10,

        [ValidateRange(50,1500)]
        [int]
        $PingTimeout = 250,

        [Switch]
        $SkipPing,

        [ValidateRange(1,50000000)]
        [int]
        $LoopDelay,

        [ValidatePattern('[0-9]+[smdh]')]
        [string]
        $MaxLoopTime,

        [ValidateRange(0,100)]
        [int]
        $Jitter,

        [int]
        $Throttle,

        [ValidateScript({ Test-Path -Path $_ })]
        [String]
        $JSONFolder = $(Get-Location),

        [ValidateNotNullOrEmpty()]
        [String]
        $JSONPrefix,

        [Switch]
        $NoZip,

        [Switch]
        $EncryptZip,

        [String]
        $ZipFileName,

        [Switch]
        $RandomFilenames,

        [Switch]
        $PrettyJson,
        

        [String]
        [ValidateNotNullOrEmpty()]
        $CacheFile,

        [Switch]
        $Invalidate,

        [Switch]
        $NoSaveCache,

        [ValidateRange(500,60000)]
        [int]
        $StatusInterval,

        [Switch]
        $Verbose
    )

    $vars = New-Object System.Collections.Generic.List[System.Object]

    $vars.Add("-c")
    foreach ($cmethod in $CollectionMethod){
        $vars.Add($cmethod);
    }
    
    if ($Domain){
        $vars.Add("-d");
        $vars.Add($Domain);
    }

    if ($SearchForest){
        $vars.Add("-s");
    }

    if ($Stealth){
        $vars.Add("--Stealth")
    }

    if ($SkipGCDeconfliction){
        $vars.Add("--SkipGCDeconfliction")
    }

    if ($ExcludeDC){
        $vars.Add("--ExcludeDC")
    }

    if ($ComputerFile){
        $vars.Add("--ComputerFile");
        $vars.Add($ComputerFile);
    }

    if ($OU){
        $vars.Add("--OU");
        $vars.Add($OU);
    }

    if ($DomainController){
        $vars.Add("--DomainController");
        $vars.Add($DomainController);
    }

    if ($LdapPort){
        $vars.Add("--LdapPort");
        $vars.Add($LdapPort);
    }

    if ($SecureLdap){
        $vars.Add("--SecureLdap");
    }

    if ($IgnoreLdapCert){
        $vars.Add("--IgnoreLdapCert");
    }

    if ($LDAPUser){
        $vars.Add("--LDAPUser");
        $vars.Add($LDAPUser);
    }

    if ($LDAPPass){
        $vars.Add("--LDAPPass");
        $vars.Add($LDAPPass);
    }

    if ($DisableKerbSigning){
        $vars.Add("--DisableKerbSigning");
    }

    if ($Threads){
        $vars.Add("-t")
        $vars.Add($Threads)
    }

    if ($PingTimeout){
        $vars.Add("--PingTimeout")
        $vars.Add($PingTimeout)
    }

    if ($SkipPing){
        $vars.Add("--SkipPing");
    }

    if ($LoopDelay){
        $vars.Add("--LoopDelay")
        $vars.Add($LoopDelay)
    }

    if ($MaxLoopTime){
        $vars.Add("--MaxLoopTime")
        $vars.Add($MaxLoopTime)
    }

    if ($Throttle){
        $vars.Add("--Throttle");
        $vars.Add($Throttle);
    }

    if ($Jitter){
        $vars.Add("--Jitter");
        $vars.Add($Jitter);
    }

    if ($JSONFolder){
        $vars.Add("--JSONFolder");
        $vars.Add($JSONFolder);
    }

    if ($JSONPrefix){
        $vars.Add("--JSONPrefix");
        $vars.Add($JSONPrefix);
    }

    if ($NoZip){
        $vars.Add("--NoZip");
    }

    if ($EncryptZip){
        $vars.Add("--EncryptZip");
    }

    if ($ZipFileName){
        $vars.Add("--ZipFileName");
        $vars.Add($ZipFileName);
    }

    if ($RandomFilenames){
        $vars.Add("--RandomFilenames");
    }

    if ($PrettyJson){
        $vars.Add("--PrettyJson");
    }

    if ($CacheFile){
        $vars.Add("--CacheFile")
        $vars.Add($CacheFile)
    }

    if ($Invalidate){
        $vars.Add("--Invalidate")
    }

    if ($NoSaveCache){
        $vars.Add("--NoSaveCache")
    }

    if ($Verbose){
        $vars.Add("-v")
    }

    if ($StatusInterval){
        $vars.Add("--StatusInterval")
        $vars.Add($StatusInterval)
    }   

    $passed = [string[]]$vars.ToArray()

        $EncodedCompressedFile = ''
    $DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
    $UncompressedFileBytes = New-Object Byte[](744960)
    $DeflatedStream.Read($UncompressedFileBytes, 0, 744960) | Out-Null
    $Assembly = [Reflection.Assembly]::Load($UncompressedFileBytes)
    $BindingFlags = [Reflection.BindingFlags] "Public,Static"
    $a = @()
    $Assembly.GetType("Costura.AssemblyLoader", $false).GetMethod("Attach", $BindingFlags).Invoke($Null, @())
    $Assembly.GetType("Sharphound2.Sharphound").GetMethod("InvokeBloodHound").Invoke($Null, @(,$passed))
}